      <HeroMain />
      <p className="text-gray-200">Revolutionizing Competitions. Compete Fairer.</p>
      <Button className="mt-10 w-[30em] ">
        <p className="text-2xl text-center">Get Started - It's Free</p>
      </Button>
      <LPAssets />
    </div>
  );
};

export default Hero;
